import React from "react";

const OrganSelect = ({organs}) => {

    const organSelect = organs.map((organ) => {
        return (
            <div key={organ._id}>
                <h2>{organ.name}</h2>
                <img src={organ.diagram} alt="Organ-diagram" />
            </div>


        )
    })
    return ( 
        <div>
            {organSelect}
        </div>
     );
}

export default OrganSelect;
